body {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

#app {
    height: 160px;
    position: relative;
    overflow: hidden;
}

.layer {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;

    --offset: 0px;
    --blur: 2px;
}

.layer > img {
    /*border: 1px solid red;*/
    display: block;
    /*width: 110%;*/
    /*height: 110%;*/
    /*object-fit: cover;*/

    transform: translateX(var(--offset));
    filter: blur(var(--blur));

}
